import React, { Component } from 'react'
import Item from '../Item'
import './index.css'

export default class List extends Component {
  render() {
  const {todos,changList} = this.props
    return (
      <ul className='todo-main'>
        {
          todos.map((todoObj) => {
            return <Item key={todoObj.id} {...todoObj} changList={changList}/>
          }
          )
        }
    </ul>
    )
  }
}
